import { GET_ALL_POSTS } from '../actions/post.actions'

const initialState = {}

export default function allPOostsReducer(state = initialState, action) {
  switch (action.type) {
    case GET_ALL_POSTS:
      return action.paylod
    default:
      return state
  }
}
